import React, {useState, useEffect}  from 'react';
import axios from 'axios';
import './App.css';
import TelaInfo from './TelaInfo'
import TelaList from './TelaList'

export default function App() {
  const [tela, setTela] = useState("info")

  const trocaTela = () => {
    if (tela === "info") {
      setTela("list")
    } else {
      setTela("info")
    }
  };
  return (
    <div>
       <button onClick={trocaTela}>Trocar de tela</button>
        {tela === "info" ? <TelaInfo /> : <TelaList/>}
    </div>
  );
}
